    Solution sol;
    vector<int> ns = {3, 2, 3};
    cout<<sol.majorityElement(ns)<<endl;
    vector<int> ns1 = {2, 2, 1, 1, 1, 2, 2};
    cout<<sol.majorityElement(ns1)<<endl;
